"use strict";

const router = require("express")();

const { ObjectId } = require("bson");
const { sendJSON } = require("../middleware/return-object");

// Create Indexes
// db.users.createIndex({email:1}, {unique:true})
// db.users.createIndex({username:1}, {unique:true})

// View Data Structure for Development
router.route("/reset/getusers")
  .get((req, res)=>req.db.db.collection("users").find({}).limit(5).toArray(sendJSON.bind(res)));

router.route("/reset/getposts")
  .get((req, res)=>req.db.db.collection("posts").find({}).limit(5).toArray(sendJSON.bind(res)));

// Reset All Data
// '/users/reset/alldata'
router.route("/reset/alldata")
  .post((req, res, next) => {

    // Update Users
    resetdata (req.db.db.collection("users"), users())

    // Update Posts
    .then(() => resetdata (req.db.db.collection("posts"), posts()))

    // Send Response
    .then(()=>sendJSON.call(res, null, "Data Reset Successful"))
    .catch(next); 

});


function resetdata (collectionRef, data) {

    // Delete All Data
    return collectionRef.deleteMany({})

    // Insert New Data
    .then(() => collectionRef.insertMany(data))
      
    // Get New Database Count for Verification
    .then(() => collectionRef.countDocuments({}))
    
    // Verify Count
    .then(n => {

      if (n !== data.length) {
        throw "Data Reset Error. Final Count Does Not Match in " + collectionRef.name + " Collection.";
      }
      
    });
    
}


module.exports = router;


